import React from 'react';

function SearchBar() {
  const { data } = useContext(StarWarsContext);

  const { results } = data;
  return (
    <div>
      <table>
        <thead>
          <tr>
            {results && Object.keys(results[0])
              .filter(((item) => item !== 'residents'))
              .map((item) => <th key={ item }>{item}</th>)}
          </tr>
        </thead>
        <tbody>
          {results && results.map((item) => {
            const {
              name,
              rotation_period: rotationPeriod,
              orbital_period: orbitalPeriod,
              diameter,
              climate,
              gravity,
              terrain,
              surface_water: surfaceWater,
              population,
              films,
              created,
              edited,
              url,
            } = item;
            return (
              <tr key={ name }>
                <td>{name}</td>
                <td>{rotationPeriod}</td>
                <td>{orbitalPeriod}</td>
                <td>{diameter}</td>
                <td>{climate}</td>
                <td>{gravity}</td>
                <td>{terrain}</td>
                <td>{surfaceWater}</td>
                <td>{population}</td>
                <td>{films}</td>
                <td>{created}</td>
                <td>{edited}</td>
                <td>{url}</td>
              </tr>
            );
          })}

        </tbody>
      </table>

    </div>

  );
}
export default SearchBar;
